import React from 'react'
import {Route, Navigate
} from 'react-router-dom'
 
const isAuth = true;
// import { Defaultlayout } from '../../layout/Defaultlayout';

export const PrivateRoute = ({children, ...rest})=>{
    return(
       <Route 
       render = {()=>
        (isAuth?{children}
       :<Navigate to='/' />)} />
    )
}
